import logo from './logo.svg'
import React from 'react';
import './App.css';

class Numpad extends React.Component {
  render() {
    return (
      <div className="numpad">

            <button id="AC" className="numpad__button">AC</button>
            <button id="/" className="numpad__button">/</button>
            <button id="*" className="numpad__button">*</button>



            <button id="7" className="numpad__button">7</button>
            <button id="8" className="numpad__button">8</button>
            <button id="9" className="numpad__button">9</button>
            <button id="-" className="numpad__button">-</button>



            <button id="4" className="numpad__button">4</button>
            <button id="5" className="numpad__button">5</button>
            <button id="6" className="numpad__button">6</button>
            <button id="+" className="numpad__button">+</button>



            <button id="1" className="numpad__button">1</button>
            <button id="2" className="numpad__button">2</button>
            <button id="3" className="numpad__button">3</button>
            <button id="=" className="numpad__button">=</button>



            <button id="0" className="numpad__button">0</button>
            <button id="." className="numpad__button">.</button>






      </div>
    );
  }
}

class Display extends React.Component {
  render() {
    return (
      <div className="display">
        <div className="display__output">0</div>
      </div>
    );
  }
}

class Calculator extends React.Component {
  render() {
    return (
      <div className="calculator">
        <Display />
        <Numpad />
      </div>
    );
  }
}

class App extends React.Component {
  render() {
    return (
        <div className="App">
          <Calculator />
        </div>

    );
  }
}

export default App;
